import React, { Component } from 'react';
import fireDb from '../../firebase-config';
import styleBarraFiltro from './MobiliarioStyle/BarraFiltro.module.css';

export default class BarraFiltro extends Component {

    state = {
        eventoAtrevete: [],
        anotherBool: false,
    }


    componentDidMount() {
        fireDb.firestore().collection("atrevete")
            .get()
            .then(snapshot => {
                const eventoAtrevete = []
                console.log(snapshot);
                snapshot.forEach(doc => {
                    const data = doc.data()
                    eventoAtrevete.push(data)
                })
                this.setState({ eventoAtrevete: eventoAtrevete, anotherBool: true })
            })
            .catch(error => console.log(error))
    }



    render() {

        return (
            <div className={styleBarraFiltro.gridBarraFiltro}>
                <Eventos> </Eventos>
            </div>
        )



    }
}
